HolaIO=function(a){this.key=a;this.serverurl="https://api.io.holalabs.com/";insertScript=function(c){var b=document.createElement("script");b.setAttribute("type","text/javascript");b.setAttribute("src",c);if(typeof b!="undefined"){}document.getElementsByTagName("head")[0].appendChild(b);return b};this.login=function(){var c=this.serverurl+"login/"+this.key+"?jsonp=HolaIO.authed";var b=insertScript(c)};this.login();this.get=function(f,b,d,e){if(HolaIO.logged){f=encodeURI(f);b=encodeURI(b);var c=this.serverurl+f+"/"+b+"/"+d+"?jsonp="+e;insertScript(c)}else{var g=this;setTimeout(function(){g.get(f,b,d,e)},100)}}};HolaIO.logged=false;HolaIO.authed=function(){HolaIO.logged=true};